import React from 'react'; 
import Navbar from './components/Navbar';
import './styles.scss'; 

const Admin = () => (
    <div className="admin-container">
        <Navbar />
        <div className="admin-content">
            <h1>Conteudo</h1>
        </div>
    </div>
); 

export default Admin;
